import React from 'react'
import CartItem from './CartItem'

function Cart({ products, cart, handler }) {
    console.log('Cart')
    console.log(products)
    console.log(cart)
    return (
        Object.keys(cart).map(cur_key => {
            console.log(cur_key)
            return <CartItem key={cur_key} product={products.find(prod => Number(prod.id) === Number(cur_key))} count={cart[cur_key]} deletionHandler={handler} />
        })
    )
}

export default Cart
